ef=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-76_%D0%B2_%D0%9C%D0%BE%D0%B3%D0%B0%D0%B4%D0%B8%D1%88%D0%BE_23_%D0%BC%D0%B0%D1%80%D1%82%D0%B0_2007\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-76 \u0432 \u041c\u043e\u0433\u0430\u0434\u0438\u0448\u043e 23 \u043c\u0430\u0440\u0442\u0430 2007\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-76<\/a> \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B0%D0%BD%D1%81%D0%90%D0%B2%D0%B8%D0%B0%D0%AD%D0%BA%D1%81%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u0422\u0440\u0430\u043d\u0441\u0410\u0432\u0438\u0430\u042d\u043a\u0441\u043f\u043e\u0440\u0442\">\u0422\u0440\u0430\u043d\u0441\u0410\u0432\u0438\u0430\u042d\u043a\u0441\u043f\u043e\u0440\u0442<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B3%D0%B0%D0%B4%D0%B8%D1%88%D0%BE\" title=\"\u041c\u043e\u0433\u0430\u0434\u0438\u0448\u043e\">\u041c\u043e\u0433\u0430\u0434\u0438\u0448\u043e<\/a>.<\/li><\/ul><h2>"}